import logo from './4me.png';
import './App.css';
import { useNavigate } from 'react-router-dom';

function App() {
  const navigate = useNavigate();
  return (
    <div className="App">
      <h1 className="App-header">
        Acronym for me
      </h1>
      <img src={logo} className="App-logo" alt="logo" />
      <div></div>
      <button type="button" className="App-button" onClick={() => navigate('/pages/findagame')} >search for game</button>
    </div>
  );
}

export default App;
